import { Component,Input,OnInit } from '@angular/core';

@Component({
  selector: 'app-card',
  templateUrl: './card.component.html',
  styleUrls: ['./card.component.css']
})
export class CardComponent implements OnInit {
  @Input() item:any ;
  cartType_simple:boolean = false;
  cartType_flip:boolean = false;
  imagePath:string="";
  cartType_User_Profile_Card:boolean = false;
  ngOnInit() {
  
   if(this.item=="contact_card"){
    this.cartType_simple = true;
    this.imagePath ="data:image/jpeg;base64,";
   }
    if(this.item=="contact_card_flip"){
    this.cartType_flip = true;
    this.imagePath ="data:image/jpeg;base64,";
   }
   if(this.item=="cartTypeUserProfileCard"){
    this.cartType_User_Profile_Card = true;
    this.imagePath ="data:image/jpeg;base64,";
   }
  }
}
